import React from 'react';

import {Layout, Menu, Breadcrumb,Affix,Drawer, Button} from 'antd';

//  https://medium.com/zestgeek/ant-design-navbar-with-responsive-drawer-a8d718e471e0
export default function Navigation(){

  const { Header, Content, Footer } = Layout;



  return (
    <div>

    <Header style={{ position: 'fixed', zIndex: 1, width: '100%', backgroundColor: 'rgba(0,0,0,0)'}}>
      <div className="logo" />
      <Menu mode="horizontal" defaultSelectedKeys={['2']} style={{backgroundColor: 'rgba(0,0,0,0)'}}>
        <Menu.Item key="1">nav 1</Menu.Item>
        <Menu.Item key="2">nav 2</Menu.Item>
        <Menu.Item key="3">nav 3</Menu.Item>
      </Menu>
    </Header>




    </div>
  );
}
